import React from 'react';
import { Paper, makeStyles } from '@mui/material';

const useStyles = makeStyles((theme) => ({
  paper: {
    padding: theme.spacing(2),
    margin: 'auto',
    maxWidth: 500,
  },
}));

const SettingsForm = () => {
  const classes = useStyles();

  return (
    <Paper className={classes.paper}>
      SettingsForm
    </Paper>
  );
};

export default SettingsForm;
